.','The site you were looking for, %s, does not exist.'=>'Сайта, который вы ищете, %s, не существует.','The site you were looking for, %s, does not exist, but you can create it now!'=>'Сайта, который вы ищете, <strong>%s</strong>, не существует. Но его можно создать прямо сейчас!','You are logged in already. No need to register again!'=>'Вы уже вошли на сайт. Нет нужды регистрироваться снова!','Sorry, new registrations are not allowed at this time.'=>'Извините, в настоящий момент регистрация закрыта.','Site registration has been disabled.'=>'Регистрация сайтов отключена.','User registration has been disabled.'=>'Регистрация пользователей отключена.','You must first <a href="%s">log in</a>, and then you can create a new site.'=>'Вам необходимо <a href="%s">авторизоваться</a>, чтобы создать новый сайт.','Registration has been disabled.'=>'Регистрация отключена.','To change or disable registration go to your <a href="%s">Options page</a>.'=>'Для изменения настроек или отключения регистрации пройдите на <a href="%s">Страницу настроек</a>.','The network currently allows both site and user registrations.'=>'Регистрация сайтов и пользователей в сети разрешена.','The network currently allows user registrations.'=>'Регистрация пользователей в сети разрешена.','The network currently allows site registrations.'=>'Регистрация сайтов в сети разрешена.','The network currently disallows registrations.'=>'Регистрация сайтов и пользователей в сети запрещена.','Greetings Network Administrator!'=>'Приветствуем Администратора Сети!','Have you entered your email correctly? You have entered %s, if it&#8217;s incorrect, you will not receive your email.'=>'Вы правильно указали свой email? У нас он записан как %s, но если это неправильный адрес, письмо не придёт.','Check the junk or spam folder of your email client. Sometime emails wind up there by mistake.'=>'Проверьте корзину или папку для спама в вашем почтовом клиенте. Иногда письма по ошибке оказываются там.','Wait a little longer. Sometimes delivery of email can be delayed by processes outside of our control.'=>'Подождите ещё немного. Иногда доставка электронного письма может задержаться по независящим от нас причинам.','If you have not received your email yet, there are a number of things you can do:'=>'Если вы еще не получили сообщение по Email, вы пока можете:','Still waiting for your email?'=>'Всё ещё ждёте письмо?','If you do not activate your site within two days, you will have to sign up again.'=>'Если вы не активируете ваш сайт в течение двух дней, вам придётся регистрироваться заново.','But, before you can start using your site, <strong>you must activate it</strong>.'=>'Но прежде чем вы сможете пользоваться своим сайтом, <strong>нужно его активировать</strong>.','Congratulations! Your new site, %s, is almost ready.'=>'Поздравляем! Ваш новый сайт, %s, почти готов.','Sign up'=>'Зарегистрироваться','If you do not activate your username within two days, you will have to sign up again.'=>'Если вы не активируете своё имя пользователя в течение двух дней, вам придётся регистрироваться заново.','Check your inbox at %s and click the link given.'=>'Проверьте почтовый ящик %s и перейдите по полученной ссылке.','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'Но прежде чем вы начнёте использовать своё новое имя пользователя, <strong>нужно его активировать</strong>.','%s is your new username'=>'%s &#8212 ваше новое имя пользователя','Just a username, please.'=>'Только имя пользователя, пожалуйста.','Gimme a site!'=>'Дайте мне сайт!','Create a site or only a username:'=>'Создать сайт или только имя пользователя:','Get your own %s account in seconds'=>'Создайте учётную запись в сети &laquo;%s&raquo; за считанные секунды','%1$s is your new site. <a href="%2$s">Log in</a> as &#8220;%3$s&#8221; using your existing password.'=>'%1$s - ваш новый сайт. <a href="%2$s">Войдите</a> как &#8220;%3$s&#8221;, используя ваш пароль.','The site %s is yours.'=>'Сайт &laquo;%s&raquo; &#8212; ваш.','Create Site'=>'Создать сайт','If you are not going to use a great site domain, leave it for a new user. Now have at it!'=>'Если вы не собираетесь использовать отличный домен, оставьте его для новых пользователей. А теперь приступайте!','Sites you are already a member of:'=>'Сайты, участником которых вы являетесь:','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'Добро пожаловать, %s. Заполнив форму ниже, вы сможете <strong>добавить к вашей учётной записи ещё один сайт</strong>. На количество сайтов нет ограничений, но к написанию материалов подходите ответственно!','There was a problem, please correct the form below and try again.'=>'Что-то не получилось. Пожалуйста, исправьте данные в этой форме и попробуйте ещё раз.','Get <em>another</em> %s site in seconds'=>'Получите <em>ещё один</em> сайт в сети &laquo;%s&raquo; за считанные секунды','Your registration email is sent to this address. (Double-check your email address before continuing.)'=>'На этот адрес будет отправлено письмо для подтверждения. (Внимательно проверьте адрес email, перед тем как продолжить.)','Email&nbsp;Address:'=>'Адрес&nbsp;email:','(Must be at least 4 characters, lowercase letters and numbers only.)'=>'(Не менее 4 символов, только буквы и цифры.)','No'=>'Нет','Yes'=>'Да','Allow search engines to index this site.'=>'Разрешить поисковым системам индексировать сайт.','Privacy:'=>'Приватность:','Site Language:'=>'Язык сайта:','Site Title:'=>'Название сайта:','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'Не менее 4 символов, только буквы и цифры. Значение нельзя изменить позже, будьте внимательны!','Your address will be %s.'=>'Вашим адресом будет %s.','domain'=>'домен','sitename'=>'имя-сайта','Site Domain (subdomain only):'=>'Домен сайта 