elp, please see <a href="%1$s">this documentation</a> or try the <a href="%2$s">support forums</a>.'=>'<strong>Ошибка</strong>: Cookies заблокированы из-за неожиданного вывода на экран. Посмотрите <a href="%1$s">документацию</a> или обратитесь за помощью на <a href="%2$s">форумы поддержки</a>.','User action confirmed.'=>'Действие пользователя подтверждено.','Missing confirm key.'=>'Отсутствует ключ подтверждения.','Missing request ID.'=>'Отсутствует ID запроса.','Check your email'=>'Проверьте вашу почту','Registration complete. Please check your email, then visit the <a href="%s">login page</a>.'=>'Регистрация завершена, проверьте вашу почту, затем зайдите на <a href="%s">страницу входа</a>.','Check your email for the confirmation link, then visit the <a href="%s">login page</a>.'=>'Проверьте вашу почту для ссылки с подтверждением, затем зайдите на <a href="%s">страницу входа</a>.','Registration confirmation will be emailed to you.'=>'Подтверждение регистрации будет отправлено на ваш email.','Username'=>'Имя пользователя','Register For This Site'=>'Зарегистрироваться на этом сайте','Registration Form'=>'Регистрационная форма','Save Password'=>'Сохранить пароль','Generate Password'=>'Создать пароль','Confirm new password'=>'Подтвердите новый пароль','Confirm use of weak password'=>'Разрешить использование слабого пароля.','Strength indicator'=>'Индикатор надёжности','Hide password'=>'Скрыть пароль','New password'=>'Новый пароль','Enter your new password below or generate one.'=>'Введите ваш пароль ниже или создайте его.','Reset Password'=>'Задать пароль','Your password has been reset.'=>'Ваш новый пароль вступил в силу.','Password Reset'=>'Сброс пароля','<strong>Error:</strong> The passwords do not match.'=>'<strong>Ошибка:</strong> Пароли не совпадают.','The password cannot be a space or all spaces.'=>'Пароль не может быть пробелом или состоять из пробелов.','Get New Password'=>'Получить новый пароль','Please enter your username or email address. You will receive an