мментарий' . "\0" . '%s комментария' . "\0" . '%s комментариев','comment_excerpt_length20'=>'20','Password protected'=>'Защищено паролем','<strong>Error:</strong> WordPress %1$s requires MySQL %2$s or higher'=>'<strong>Ошибка</strong>: WordPress %1$s требует MySQL %2$s или выше','Could not strip invalid text.'=>'Не удалось удалить неверный текст.','Could not retrieve table charset.'=>'Не удалось получить кодировку таблицы.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'Ошибка базы данных WordPress: Обработка значений для следующих полей не удалась: %s. Значения полей могут иметь избыточную длину или содержать неверные данные.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'Ошибка базы данных WordPress: Обработка значения для следующего поля не удалась: %s. Значение может иметь избыточную длину или содержать неверные данные.','Unable to retrieve the error message from MySQL'=>'Не удалось получить текст ошибки от MySQL','WordPress database error: Could not perform query because it contains invalid data.'=>'Ошибка базы данных WordPress: Не удалось выполнить запрос, так как он содержит неверные данные.','Are you sure the database server is not under particularly heavy load?'=>'Вы уверены, что сервер базы данных не находится под большой нагрузкой?','This means that the contact with the database server at %s was lost. This could mean your host&#8217;s database server is down.'=>'Это значит, что связь с сервером базы данных по адресу %s утеряна. Возможно, сервер недоступен.','Error reconnecting to the database'=>'Ошибка повторного подключения к базе данных','If you are unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href="%s">WordPress support forums</a>.'=>'Если вы не знаете, что означают эти термины &#8212; возможно, стоит обратиться к хостинг-провайдеру. Если и после этого вам понадобится помощь &#8212; всегда можно посетить <a href="%s">форум поддержки WordPress</a>.','Are you sure the database server is running?'=>'Вы уверены, что сервер базы данных запущен?','Are you sure you have typed the correct hostname?'=>'Вы уверены, что ввели правильное имя сервера?','Are you sure you have the correct username and password?'=>'Вы уверены, что указали правильное имя пользователя и пароль?','This either means that the username and password information in your %1$s file is incorrect or that contact with the database server at %2$s could not be established. This could mean your host&#8217;s database server is down.'=>'Это значит, что либо имя пользователя и пароль в файле %1$s неверны, либо нам не удалось связаться с сервером базы данных по адресу %2$s. Возможно, сервер недоступен.','Error establishing a database connection'=>'Ошибка установки соединения с базой данных','WordPress database error:'=>'Ошибка базы данных WordPress:','Unsupported value type (%s).'=>'Неподдерживаемый тип значения (%s).','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'Число описателей преобразований в запросе (%1$d) не соответствует количеству переданных аргументов (%2$d).','The query only expected one placeholder, but an array of multiple placeholders was sent.'=>'В запросе ожидался только один описатель преобразований, но обнаружен массив из множества описателей.','Arguments cannot be prepared as both an Identifier and Value. Found the following conflicts: %s'=>'Аргументы не могут быть подготовлены одновременно как идентификатор и значение. Обнаружены следующие конфликты: %s','The query argument of %s must have a placeholder.'=>'Аргумент запроса метода %s должен содержать описатель преобразований.','%s must set a database connection for use with escaping.'=>'Класс %s должен указать соединение, используемое для экранирования.','If you do not know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="%s">WordPress support forums</a>.'=>'Если вы не знаете, как настроить доступ к базе данных, следует <strong>обратиться к хостинг-провайдеру</strong>. Если проблему так и не удалось решить &#8212; возможно, вам помогут на <a href="%s">форуме поддержки WordPress</a>.','On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?'=>'В некоторых системах имя базы данных дополняется именем пользователя в виде префикса, получается что-то вроде <code>username_%1$s</code>. Возможно, причина в этом?','Does the user %1$s have permission to use the %2$s database?'=>'Имеет ли пользователь %1$s права на использование базы данных %2$s?','Are you sure it exists?'=>'Вы уверены, что она существует?','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'Подключение к серверу базы данных может быть создано (это означает, что ваше имя пользователя и пароль в порядке), но база данных %s не может быть выбрана.','Cannot select database'=>'Не удалось выбрать базу данных','Sorry, you are not allowed to view this item.'=>'Извините, вам не разрешено просматривать этот элемент.','A variable mismatch has been detected.'=>'Обнаружено несовпадение переменных.','The specified target URL does not exist.'=>'Указанная ссылка не найдена.','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'Уведомление от %1$s к %2$s зарегистрировано. Люди говорят! :-)','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'Адрес источника не содержит ссылки на получателя, и потому не может быть использован как источник.','A title on that page cannot be found.'=>'Название на этой странице не найдено.','The source URL does not exist.'=>'Ссылка на ис