me, %s.'=>'В этот раз WordPress нашел ошибку с темой - %s.','In this case, WordPress caught an error with one of your plugins, %s.'=>'В этот раз WordPress нашел ошибку с одним из плагинов - %s.','[%s] Your Site is Experiencing a Technical Issue'=>'[%s] На сайте возникли технические проблемы','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Привет!

Начиная с версии 5.2 WordPress может определять возникающие ошибки с плагинами или темой на сайте и присылать вам подобные сообщения автоматически.
###CAUSE###
Сначала зайдите на ваш сайт (###SITEURL###) и проверьте все видимые проблемы. Далее, зайдите на страницу, на которой возникла ошибка (###PAGEURL###) и проверьте видимые проблемы на ней.

###SUPPORT###

Если ваш сайт сломан и вы не сможете нормально войти в консоль, теперь можно использовать специальный "режим восстановления", который позволит безопасно войти в консоль для дальнейших действий.

###LINK###

В целях безопасности действие этой ссылки истекает через ###EXPIRES###. Но не беспокойтесь, если ошибка возникнет снова по истечении этого времени, то вам будет выслана новая ссылка.

Для решения проблемы вам потребуется следующая информация:

