 display it.'=>'Ваша тема имеет одну область для виджетов, но эта страница не показывает ее.','Your theme has %s other widget area, but this particular page does not display it.'=>'Ваша тема имеет %s другую область для виджетов, но эта страница не показывает ее.' . "\0" . 'Ваша тема имеет %s других области для виджетов, но эта страница не показывает их.' . "\0" . 'Ваша тема имеет %s других областей для виджетов, но эта страница не показывает их.','Your theme has 1 other widget area, but this particular page does not display it.'=>'Ваша тема имеет одну другую область для виджетов, но эта страница не показывает ее.','Move widgetMove'=>'Переместить','Select an area to move this widget into:'=>'Выберите область, в которую будет перемещён виджет:','Move to another area&hellip;'=>'Переместить в другую область&hellip;','Widgets are independent sections of content that can be placed into widgetized areas provided by your theme (commonly called sidebars).'=>'Виджеты &#8212; это независимые блоки содержимого, которые можно размещать в областях, предусмотренных вашей темой (обычно их называют боковыми колонками).','Press return or enter to open this section'=>'Нажмите Enter, чтобы открыть эту секцию','Customizing'=>'Настройка','Help'=>'Помощь','You are customizing %s'=>'Вы настраиваете %s','Press return or enter to open this panel'=>'Нажмите Enter, чтобы открыть эту панель','Add to Menu'=>'Добавить в меню','Link Text'=>'Текст ссылки','URL'=>'URL','Toggle section: Custom Links'=>'Скрыть/показать секцию: Произвольные ссылки','Custom Links'=>'Произвольные ссылки','Toggle section: %s'=>'Скрыть/показать секцию: %s','No items'=>'Нет элементов','Clear Results'=>'Очистить результаты','The search results will be updated as you type.'=>'Результаты поиска обновляются по мере набора.','Search menu items&hellip;'=>'Поиск элементов меню&hellip;','Search Menu Items'=>'Искать элементы меню','Add Menu Items'=>'Добавить','Back'=>'Назад','Create New Menu'=>'Создать новое меню','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Вы создадите меню, назначите место для него, добавите элементы меню, такие как ссылки на страницы и рубрики. Если ваша тема поддерживает несколько областей для меню, возможно вам нужно создать больше чем одно.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Похоже, на вашем сайте ещё нет никакого меню. Хотите создать его? Нажмите кнопку, чтобы начать.','Next'=>'Далее','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Нажмите &#8220;Далее&#8221;, чтобы начать добавлять ссылки в ваше новое меню.','Delete Menu'=>'Удалить меню','Move one level down'=>'Переместить на уровень ниже','Move one level up'=>'Переместить на уровень выше','Move down'=>'Переместить вниз','Move up'=>'Переместить вверх','Add to menu: %1$s (%2$s)'=>'Добавить в меню: %1$s (%2$s)','%1$s could not be created: %2$s'=>'%1$s не может быть создан: %2$s','Post'=>'Запись','Status is forbidden.'=>'Статус запрещен.','Empty title.'=>'Пустой заголовок.','Invalid post type.'=>'Неверный тип записи.','New Menu'=>'Новое меню','menu locationsView All Locations'=>'Посмотреть все места','menu locationsView Location'=>'Посмотреть место' . "\0" . 'Посмотреть все места' . "\0" . 'Посмотреть все места','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Если используемая тема имеет области виджетов, то вы можете также добавить туда меню. Зайдите на <a href="%s">панель управления виджетами</a> и добавьте &#8220;Виджет меню навигации&#8221;, чтобы отображать меню на боковой панели или в подвале.','Your theme can display menus in %s location. Select which menu you would like to use.'=>'Ваша тема поддерживает отображение меню в %s области. Выберите какое меню вы хотите использовать.' . "\0" . 'Ваша тема поддерживает отображение меню в %s областях. Выберите какое меню вы хотите использовать.' . "\0" . 'Ваша тема поддерживает отображение меню в %s областях. Выберите какое меню вы хотите использовать.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Ваша тема может отображать меню в одной области. Выберите меню, которое вы хотите использовать.','Menus can be displayed in locations defined by your theme.'=>'Меню могут отображаться в областях, предусмотренных темой оформления.','Menus can be displayed in locations defined by your theme or in <a href="%s">widget areas</a> by adding a &#8220;Navigation Menu&#8221; widget.'=>'Меню могут отображаться в областях, предусмотренных темой оформления, или в <a href="%s">областях виджетов</a> при добавлении туда виджета &laquo;Меню навигации&raquo;.','This panel is used for managing navigation menus for content you have already published on your site. You can create menus and add items for existing content such as pages, posts, categories, tags, formats, or custom links.'=>'Эта панель используется для управления меню на основе опубликованного содержимого. Можно создавать меню и добавлять ссылки на страницы, записи, рубрики, метки, форматы записей или произвольные ссылки.','%1$s. Sub item number %2$d under %3$s.'=>'%1$s. Дочерний элемент номер %2$d элемента %3$s.','%1$s. Menu item %2$d of %3$d.'=>'%1$s. Элемент меню %2$d из %3$d.','Out from under %s'=>'Из-под «%s»','Under %s'=>'Под «%s»','Move out from under %s'=>'Переместить из-под «%s»','Move under %s'=>'Переместить под «%s»','Move to the top'=>'Переместить наверх','Move down one'=>'Переместить ниже','Move up one'=>'Переместить выше','Close reorder mode'=>'Закрыть режим изменения порядка','Reorder menu items'=>'Изменить порядок элементов меню','Reorder mode closed'=>'Режим изменения порядка закрыт','Reorder mode enabled'=>'Режим изменения порядка включён','Loading more results.