аны как видео заголовка. Пожалуйста, сконвертируйте ваш видеоролик и попробуйте снова, или загрузите его на YouTube и дайте ссылку с помощью настройки ниже.','This video file is too large to use as a header video. Try a shorter video or optimize the compression settings and re-upload a file that is less than 8MB. Or, upload your video to YouTube and link it with the option below.'=>'Видеофайл слишком большой для использования в качестве видео заголовка. Попробуйте более короткий видеоролик или оптимизируйте настройки сжатия и загрузите заново файл размером менее 8 МБ. Либо загрузите видео на YouTube и используйте ссылку в настройках ниже.','Unrecognized background setting.'=>'Нераспознанные настройки фона.','Invalid value for background size.'=>'Неверное значение для размера фона.','Invalid value for background position Y.'=>'Неверное значение для позиции фона Y.','Invalid value for background position X.'=>'Неверное значение для позиции фона X.','Invalid value for background attachment.'=>'Неверное значение для вложения фона.','Invalid value for background repeat.'=>'Неверное значение для повтора фона.','CSS code'=>'код CSS','Additional CSS'=>'Дополнительные стили','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Поле редактирования автоматически подсвечивает синтаксис кода. Вы можете отключить это у себя в <a href="%1$s" %2$s>профиле пользователя%3$s</a> и работать как с обычным текстом.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'При использовании программы чтения с экрана: в режиме форм вам потребуется нажать кнопку Esc дважды.','To move away from this area, press the Esc key followed by the Tab key.'=>'Чтобы покинуть эту область, нажмие Esc и следом Tab.','In the editing area, the Tab key enters a tab character.'=>'В области редактирования кнопка Tab вставляет символ табуляции.','When using a keyboard to navigate:'