y other user.'=>'Набор изменений редактируется другим пользователем.','Invalid value.'=>'Неверное значение.','Unauthorized to modify setting due to capability.'=>'Нет разрешения для изменения настроек в возможностях.','Setting does not exist or is unrecognized.'=>'Настройка отсутствует или не распознана.','This form is not live-previewable.'=>'Эта форма не имеет живого предпросмотра.','This link is not live-previewable.'=>'Эта ссылка не имеет живого предпросмотра.','Shift-click to edit this element.'=>'Щёлкните, удерживая Shift, чтобы изменить элемент.','Unauthorized. You may remove the %s param to preview as frontend.'=>'Нет авторизации. Вы можете убрать параметр %s для предварительного просмотра внешней части сайта.','The requested theme does not exist.'=>'Запрошенная тема не найдена.','Sorry, you are not allowed to edit theme options on this site.'=>'Извините, вам не разрешено менять настройки темы на этом сайте.','Non-existent changeset UUID.'=>'Несуществующий UUID набора изменений.','Invalid changeset UUID'=>'Неверный UUID набора изменений','Sorry, you are not allowed to customize this site.'=>'Извините, вам не разрешено настраивать этот сайт.','You need a higher level of permission.'=>'Вам требуется более высокий уровень доступа.','Something went wrong.'=>'Что-то пошло не так.','Add'=>'Добавить','New page title&hellip;'=>'Новое название страницы&hellip;','New page title'=>'Новое название страницы','+ %s'=>'+ %s','&mdash; Select &mdash;'=>'&mdash; Выбрать &mdash;','The %s argument must be a string or a string array.'=>'Аргумент %s должен быть строкой или массивом строк.','Block type "%s" is not registered.'=>'Тип блока "%s" не зарегистрирован.','Block type "%s" is already registered.'=>'Тип блока "%s" уже зарегистрирован.','Block type names must contain a namespace prefix. Example: my-plugin/my-custom-block-type'=>'Имена типов блоков должны использовать префикс пространства имен. Например: my-plugin/my-custom-block-type','Block type names must not contain upper