$s file under %4$s. %2$s support is now declared under %5$s.'=>'Блок "%1$s" заявляет поддержку %2$s в файле %3$s с %4$s. Поддержка %2$s сейчас объявлена с %5$s.','The asset file (%1$s) for the "%2$s" defined in "%3$s" block definition is missing.'=>'Файл статического ресурса (%1$s) для "%2$s" определенный для блока "%3$s" отсутствует.','No matching template found'=>'Соответствующие шаблоны не найдены.','No matching template found.'=>'Соответствующие шаблоны не найдены.','Empty template: %s'=>'Пустой шаблон: %s','Unable to open export file (archive) for writing.'=>'Невозможно открыть файл экспорта (архив) для записи.','Zip Export not supported.'=>'Экспорт Zip не поддерживается.','Author: %s'=>'Автор: %s','Deleted author: %s'=>'Удаленный автор: %s','No theme is defined for this template.'=>'Для этого шаблона не была определена тема.','%1$s (%2$s)'=>'%1$s (%2$s)','Template for %s'=>'Шаблон для %s','%1$s: %2$s'=>'%1$s: %2$s','Not found: %1$s (%2$s)'=>'Не найдено: %1$s (%2$s)','"%1$s" is not a supported wp_template_part area value and has been added as "%2$s".'=>'%1$s: Тип области шаблона, %2$s: незарегистрированное значение области шаблона.','Displays when a visitor views a non-existent page, such as a dead link or a mistyped URL.'=>'Отображается, когда посетитель просматривает несуществующую страницу, например неработающую ссылку или введенный с ошибкой URL-адрес.','Template name404'=>'404','Displays your site\'s Privacy Policy page.'=>'Отображает страницу политики конфиденциальности вашего сайта.','Privacy Policy'=>'Политика конфиденциальности','Displays when a visitor performs a search on your website.'=>'Отображается, когда посетитель выполняет поиск на вашем сайте.','Template nameSearch'=>'Поиск','Displays when a visitor views the dedicated page that exists for any media attachment.'=>'Отображается, когда посетитель просматривает специальную страницу, которая существует для любого вложения мультимедиа.','Media'=>'Медиафайлы','Displays a post tag archive. This template will serve as a fallback when a more specific template (e.g., Tag: Pizza) cannot be found.'=>'Отображает архив меток записей. Этот шаблон будет служить запасным вариантом, когда более конкретный шаблон (например, метка: Пицца) не может быть найден.','Template nameTag'=>'Метка','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Отображает архив записей при посещении определенной даты (например, example.com/2023/).','Template nameDate'=>'Дата','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g, Taxonomy: Art) cannot be found.'=>'Отображает пользовательский архив таксономии. Как для рубрик и меток, в таксономиях есть термины, которые вы используете для классификации. Например: таксономия под названием «Искусство» может содержать несколько терминов, таких как «Современность» и «18 век». Этот шаблон будет служить запасным вариантом, когда более конкретный шаблон (например, Таксономия: Искусство) не может быть найден.','Template nameTaxonomy'=>'Таксономия','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g., Category: Recipes) cannot be found.'=>'Отображает архив рубрики записей. Этот шаблон будет служить запасным вариантом, когда более конкретный шаблон (например, рубрика: Рецепты) не может быть найден.','Template nameCategory'=>'Рубрика','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g., Author: Admin) cannot be found.'=>'Отображает архив записей одного автора. Этот шаблон будет служить запасным вариантом, когда более конкретный шаблон (например, автор: Администратор) не может быть найден.','Template nameAuthor'=>'Автор','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g., Category or Tag) cannot be found.'=>'Отображает любой архив, включая записи одного автора, рубрики, метки, таксономии, пользовательского типа записи и даты. Этот шаблон будет служить запасным вариантом, если не удастся найти более конкретные шаблоны (например, рубрику или метку).','Template nameArchive'=>'Архив','Display all static pages unless a custom template has been applied or a dedicated template exists.'=>'Отображение всех статических страниц, если не был применен пользовательский шаблон или не существует специального шаблона.','Template namePage'=>'Страница','Displays single posts on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Отображает отдельные записи сайта, если к этой записи не был применен настраиваемый шаблон или не существует специального шаблона.','Template nameSingle'=>'Одиночная','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g., Single Post, Page, or Attachment) cannot be found.'=>'Отображает любую отдельную запись, например запись или страницу. Этот шаблон будет служить запасным вариантом, если не удастся найти более конкретный шаблон (например, одиночную запись, страницу или вложение).','Template nameSingular'=>'Одиночная','Displays your site\'s front page, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Отображает главную страницу вашего сайта, независимо от того, настроена ли она для отображения последних записей или статической страницы. Шаблон главной страницы имеет приоритет над всеми шаблонами.','Template nameFront Page'=>'Главная страница','Displays the latest posts as either the site homepage or a custom page defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the front page.'=>'Отображает последние записи либо как главную страницу сайта, либо как пользовательскую страницу, определенную в настройках чтения. Если существует, шаблон главной страницы переопределяет этот шаблон при отображении записей на главной странице.','Template nameHome'=>'Главная страница','Used as a fallback template for all pages when a more specific template is not defined.'=>'Используется в качестве запасного шаблона для всех страниц, если не определен конкретный шаблон.','Template nameIndex'=>'Индексная','The Footer template defines a page area that typically contains site credits, social links, or any other combination of blocks.'=>'Шаблон подвала определяет область страницы, которая обычно содержит информацию об авторских правах, ссылки соцсетей или иную комбинацию блоков.','Footer'=>'Подвал','The Header template defines a page area that typically contains a title, logo, and main navigation.'=>'Шаблон заголовка определяет область страницы, которая обычно содержит логотип и главное меню сайта.','General templates often perform a specific role like displaying post content, and are not tied to any particular area.'=>'Общие шаблоны часто выполняют определенную роль, например, отображают содержимое записи, и не привязаны к какой-либо конкретной области.','General'=>'Общие','Raw size value must be a string, integer, or float.'=>'Необработанное значение размера должно быть строкой, целым числом или числом с плавающей запятой.','Block pattern titleSocial links with a shared background color'=>'Социальные ссылки с общим цветом фона','Block pattern titleStandard'=>'Стандартный','Block pattern titleSmall image and title'=>'Небольшое изображение и заголовок','Block pattern titleOffset'=>'Смещение','Block pattern titleImage at left'=>'Изображение слева','Block pattern titleLarge title'=>'Большой заголовок','Block pattern titleGrid'=>'Сетка','Could not register file "%s" as a block pattern ("Title" field missing)'=>'Не удалось зарегистрировать файл «%s» в качестве паттерна блока (отсутствует поле Title)','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'Не удалось зарегистрировать файл «%1$s» в качестве паттерна блока (неверный слаг «%2$s»)','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'Не удалось зарегистрировать файл «%s» в качестве паттерна блока (поле «Слаг» отсутствует)','A variety of header designs displaying your site title and navigation.'=>'Различные варианты дизайна заголовка с названием сайта и навигацией.','Block pattern categoryHeaders'=>'Заголовки','A variety of footer designs displaying information and site navigation.'=>'Различные варианты дизайна подвала с информацией и навигацией по сайту.','Block pattern categoryFooters'=>'Подвалы сайта','Different layouts containing video or audio.'=>'Различные разметки, содержащие видео или аудио.','Block pattern categoryMedia'=>'Мультимедиа','Different layouts for displaying images.'=>'Различные разметки для отображения изображений.','Block pattern categoryGallery'=>'Галерея','Showcase your latest work.'=>'Продемонстрируйте свою последнюю работу.','Block pattern categoryPortfolio'=>'Портфолио','Introduce yourself.'=>'Представьтесь.','Block pattern categoryAbout'=>'О нас','Display your contact information.'=>'Отобразите контактную информацию.','Block pattern categoryContact'=>'Контакты','Briefly describe what your business does and how you can help.'=>'Кратко опишите, чем занимается ваша организация и чем вы можете помочь.','Block pattern categoryServices'=>'Услуги','Share reviews and feedback about your brand/business.'=>'Поделитесь обзорами вашего бренда или бизнеса и отзывами о нем.','Block pattern categoryTestimonials'=>'Отзывы','A variety of designs to display your team members.'=>'Разные способы представить участников вашей команды.','Block pattern categoryTeam'=>'Команда','Sections whose purpose is to trigger a specific action.'=>'Разделы, целью которых является выполнение конкретных действий.','Block pattern categoryCall to Action'=>'Призыв к действию','A set of high quality curated patterns.'=>'Набор эксклюзивных шаблонов высокого качества.','Block pattern categoryFeatured'=>'Рекомендуемые','Display your latest posts in lists, grids or other layouts.'=>'Отображение последних записей списком, в сетке или других вариантах разметки.','Block pattern categoryPosts'=>'Записи','Patterns containing mostly text.'=>'Паттерны, содержащие в основном текст.','Block pattern categoryText'=>'Текст','Multi-column patterns with more complex layouts.'=>'Паттерны с несколькими столбцами и сложной разметкой.','Block pattern categoryColumns'=>'Столбцы','Patterns that contain buttons and call to actions.'=>'Паттерны с кнопками и призывами к действию.','Block pattern categoryButtons'=>'Кнопки','Block pattern categoryBanners'=>'Баннеры','Full Size'=>'Полный','Large'=>'Большой','Medium'=>'Средний','Thumbnail'=>'Миниатюра','block categoryReusable Blocks'=>'Мои блоки','block categoryEmbeds'=>'Вставки','block categoryTheme'=>'Тема','block categoryWidgets'=>'Виджеты','block categoryDesign'=>'Дизайн','block categoryMedia'=>'Медиа','block categoryText'=>'Текст','Display name based on first name and last name%1$s %2$s'=>'%1$s %2$s','Posts by %s'=>'Записи %s','Visit %s&#8217;s website'=>'Перейти на сайт %s','Use %s instead if you do not want the value echoed.'=>'Используйте %s, если не хотите вывести значение.','Exit Recovery Mode'=>'Выйти из режима восстановления','Search'=>'Поиск','%s update available'=>'Доступно %s обновление' . "\0" . 'Доступно %s обновления' . "\0" . 'Доступно %s обновлений','Header'=>'Заголовок','Background'=>'Фон','Menus'=>'Меню','Widgets'=>'Виджеты','%s Comment in moderation'=>'%s комментарий ждет одобрения' . "\0" . '%s комментария ждут одобрения' . "\0" . '%s комментариев ждут одобрения','admin bar menu group labelNew'=>'Добавить','add new from admin barUser'=>'Пользователя','add new from admin barLink'=>'Ссылку','Edit User'=>'Редактировать пользователя','View User'=>'Просмотр пользователя','Shortlink'=>'Короткая ссылка','Manage Comments'=>'Управление комментариями','Settings'=>'Настройки','Plugins'=>'Плагины','Themes'=>'Темы','Users'=>'Пользователи','Sites'=>'Сайты','Network Admin'=>'Управление сетью','My Sites'=>'Мои сайты','Customize'=>'Настроить','Edit site'=>'Редактировать сайт','Dashboard'=>'Консоль','Edit Site'=>'Редактировать сайт','Visit Site'=>'Перейти на сайт','User Dashboard: %s'=>'Консоль пользователя: %s','Network Admin: %s'=>'Управление сетью: %s','Log Out'=>'Выйти','Edit Profile'=>'Изменить профиль','Howdy, %s'=>'Привет, %s','Menu'=>'Меню','https://wordpress.org/support/forum/requests-and-feedback'=>'https://ru.wordpress.org/support/forum/requests-and-feedback/','Feedback'=>'Обратная связь','https://wordpress.org/support/forums/'=>'https://ru.wordpress.org/support/forums/','Support'=>'Поддержка','https://wordpress.org/documentation/'=>'https://wordpress.org/documentation/','Documentation'=>'Документация','https://wordpress.org/'=>'https://ru.wordpress.org/','WordPress.org'=>'WordPress.org','About WordPress'=>'О WordPress','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Ошибка отмены события Cron для хука %1$s, код ошибки: %2$s, сообщение об ошибке: %3$s, данные: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Ошибка перепланировки события Cron для хука %1$s, код ошибки: %2$s, сообщение об ошибке: %3$s, данные: %4$s','Quote from Hello Dolly song, by Jerry Herman:'=>'Цитата из песни Dolly song от Jerry Herman:','Comment Submission Failure'=>'Ошибка при отправке комментария','Your account is now activated. <a href="%1$s">Log in</a> or go back to the <a href="%2$s">homepage</a>.'=>'Ваша учётная запись активирована. Можно <a href="%1$s">войти</a> или вернуться на <a href="%2$s">главную страницу</a>.','Your account is now activated. <a href="%1$s">View your site</a> or <a href="%2$s">Log in</a>'=>'Ваша учётная запись активирована. Можно <a href="%1$s">перейти на ваш сайт</a> или <a href="%2$s">авторизоваться</a>','Password:'=>'Пароль:','Username:'=>'Имя пользователя:','Your site at %1$s is active. You may now log in to your site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'Ваш сайт на %1$s активен. Теперь можно войти на сайт используя выбранное имя пользователя (%2$s). Пожалуйста, проверьте почтовый ящик %3$s, там будут пароль и инструкции для входа. Если вы не получили письмо, проверьте корзину или папку со спамом. Если в течение часа вы так и не получите письмо, вы можете <a href="%4$s">сбросить ваш пароль</a>.','Your account has been activated. You may now <a href="%1$s">log in</a> to the site using your chosen username of &#8220;%2$s&#8221;. Please check your email inbox at %3$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%4$s">reset your password</a>.'=>'Ваша учётная запись активирована. Теперь можно <a href="%1$s">войти</a> на сайт, используя выбранное имя пользователя (%2$s). Пожалуйста, проверьте почтовый ящик %3$s, там будут пароль и инструкции для входа. Если вы не получили письмо, проверьте корзину или папку со спамом. Если в течение часа вы так и не получите письмо, вы можете <a href="%4$s">сбросить ваш пароль</a>.','Your account is now active!'=>'Ваша учётная запись активирована!','Activate'=>'Активировать','Activation Key:'=>'Ключ активации:','Activation Key Required'=>'Требуется ключ активации','An error occurred during the activation'=>'При активации произошла ошибка','A key value mismatch has been detected. Please follow the link provided in your activation email.'=>'Обнаружено несовпадение значений ключа. Пожалуйста, перейдите по ссылке в письме об активации.']];